import React, { Component } from "react";
import { Map, TileLayer, Marker, Popup } from "react-leaflet";
import 'leaflet/dist/leaflet.css';


class LeafletMap extends Component {
    constructor(props) {
		super(props);
		this.state = {
			lat: 51.505,
			lng: -0.09,
			zoom: 13,
		};
	}

	render() {
		const position = [this.state.lat, this.state.lng];
		return (
			<div>
				<Map center={position} zoom={this.state.zoom} style={{height : '98vh'}}>
					<TileLayer
						attribution='&amp;copy <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors &amp;copy <a href="https://carto.com/attributions">CARTO</a>'
						url="https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}{r}.png"
					/>
					<Marker position={position}>
						<Popup>
							A pretty CSS3 popup. <br /> Easily customizable.
            			</Popup>
					</Marker>
				</Map>
			</div>
		);
	}
}

export default LeafletMap;
